import React from 'react';
import BannerImage from '../Banner-Image /image-banner';

const Banner = () => {
  return (
    <div>
      <h1>Welcome to my website</h1>
      <BannerImage src="../assest/card_white.png" alt="Banner Image" style={{ maxHeight: '100%' }} />

    </div>
  );
};

export default Banner;
